
const COIN_SRC = "data:image/png;base64,";
const $ = s => document.querySelector(s);
const $$ = s => [...document.querySelectorAll(s)];
const clamp = (n,min,max)=> Math.max(min, Math.min(max,n));
const now = ()=> Date.now();
const fmt = n => (n>=1e12? (n/1e12).toFixed(2)+"T" : n>=1e9? (n/1e9).toFixed(2)+"B" : n>=1e6? (n/1e6).toFixed(2)+"M" : n>=1e3? (n/1e3).toFixed(1)+"K" : Math.floor(n).toString());
function toast(msg){ const t=$("#toast"); t.textContent=msg; t.classList.add("show"); setTimeout(()=>t.classList.remove("show"),1800); }

/* WebAudio */
let AudioCtx, masterGain, musicStarted=false;
function initAudio(){ if(AudioCtx) return; AudioCtx = new (window.AudioContext||window.webkitAudioContext)(); masterGain = AudioCtx.createGain(); masterGain.gain.value = 0.15; masterGain.connect(AudioCtx.destination); }
function blip(freq=440, dur=0.08, type="sine", vol=0.6){ if(!AudioCtx) return; const o=AudioCtx.createOscillator(); const g=AudioCtx.createGain(); o.type=type; o.frequency.value=freq; g.gain.value=vol; o.connect(g); g.connect(masterGain); o.start(); g.gain.exponentialRampToValueAtTime(0.0001, AudioCtx.currentTime + dur); o.stop(AudioCtx.currentTime + dur + 0.02); }
function chord(freqs=[440,550,660], dur=0.5){ if(!AudioCtx) return; const g=AudioCtx.createGain(); g.gain.value=.08; g.connect(masterGain); const t=AudioCtx.currentTime; freqs.forEach(f=>{ const o=AudioCtx.createOscillator(); o.type="sine"; o.frequency.value=f; o.connect(g); o.start(t); o.stop(t+dur); }); }
function startIntroMusic(){ if(musicStarted||!AudioCtx) return; musicStarted=true; const g=AudioCtx.createGain(); g.gain.value=.06; g.connect(masterGain); function tone(f,d){ const o=AudioCtx.createOscillator(); o.type="triangle"; const eg=AudioCtx.createGain(); eg.gain.value=0; o.connect(eg); eg.connect(g); o.start(); eg.gain.linearRampToValueAtTime(.8, AudioCtx.currentTime+0.05); eg.gain.exponentialRampToValueAtTime(0.001, AudioCtx.currentTime+d-0.02); o.frequency.value=f; o.stop(AudioCtx.currentTime+d); } let i=0; const notes=[261.6,329.6,392.0,523.3,392.0,329.6]; setInterval(()=>tone(notes[i++%notes.length],0.35),360); }

/* Telegram */
try{ if(window.Telegram && Telegram.WebApp){ Telegram.WebApp.ready(); const u = Telegram.WebApp.initDataUnsafe?.user?.username; if(u) $("#username").textContent = "@" + u; } }catch(e){}

/* State */
const STATE_KEY="burgercoin-game-v3";
const DefaultState={ coins:150, energy:60, maxEnergy:60, energyRegen:1, energyEveryMs:3500, gems:5, level:1, xp:0, xpMax:120, combo:1, comboTimer:0, comboMs:5000, boostMs:0, pass:false, lastSeen:now(), daily:{last:0, streak:0}, upgrades:{finger:{lvl:0}, miner:{lvl:0}, crit:{lvl:0}, energy:{lvl:0}, offline:{lvl:0}}, missions:[{id:"taps",name:"Do 100 taps",cur:0,max:100,reward:200},{id:"coins",name:"Reach 10K coins",cur:0,max:10000,reward:5,type:"gems"},{id:"level",name:"Get to level 5",cur:1,max:5,reward:1200}], wheelCooldown:0 };
let S = JSON.parse(localStorage.getItem(STATE_KEY)||"null") || DefaultState;
function save(){ localStorage.setItem(STATE_KEY, JSON.stringify(S)); }

/* Shop */
const Shop=[
  {id:"finger", name:"Power Finger", desc:"+1 coin per tap", base:30, grow:1.45},
  {id:"miner",  name:"Auto-Miner", desc:"+1 coin/s", base:120, grow:1.55},
  {id:"crit",   name:"Critical Hits", desc:"5% crit per lvl (x3)", base:140, grow:1.6},
  {id:"energy", name:"Battery", desc:"+10 max energy & regen", base:100, grow:1.5},
  {id:"offline",name:"Offline Gains", desc:"+10% /lvl (max 8h)", base:160, grow:1.6}
];
const EMOJI={finger:"👉", miner:"⛏️", crit:"💥", energy:"🔋", offline:"🌙"};
const coinImg = '<img class="icoCoin" src="'+COIN_SRC+'" alt="coin">';

/* Leaderboard 50 fake daily + user */
function generateFakeRankList(){
  const sample=["@cryptoKing","@burgerLover","@coinMaster","@tapTap","@idlePro","@fastClicker","@satoshiWannabe","@gemHunter","@level99","@burgerQueen","@elTapador","@energyBoost","@missionMan","@wheelWizard","@comboLord","@tapStorm","@coinFarmer","@gemCollector","@burgerBoss","@rankChaser","@autoMiner","@clickMachine","@xpGrinder","@dailyStreak","@offlineHero","@powerTap","@coinRain","@goldenTap","@levelUp","@boosted","@coinzilla","@gigaTap","@luckySpin","@energySaver","@burgerTapper","@theTapGod","@coinAddict","@missionHunter","@rankedUp","@burgerChain","@idleKing","@cryptoTap","@coinRush","@gemTapper","@burgerX","@supaTap","@megaClicker","@tapWarrior","@coinClicker","@burgero","@tapNinja","@clickWizard","@comboBee","@tokenTiger","@diamondDuck","@stakingSam","@alphaClick","@betaBurger","@gammaGem","@omegaTap"];
  const shuffled = sample.sort(()=>Math.random()-0.5).slice(0,50);
  return shuffled.map(n=> [0, n, Math.floor(Math.random()*5000000 + 50000)]);
}
function getDailyRank(){
  const key="burgercoin-rank-v3"; const day=24*3600*1000;
  const saved = JSON.parse(localStorage.getItem(key)||"null");
  if(saved && (now()-saved.time<day)) return saved.list;
  const list = generateFakeRankList();
  localStorage.setItem(key, JSON.stringify({time:now(), list}));
  return list;
}

/* Renders */
function renderTop(){
  $("#coins").textContent = fmt(S.coins);
  $("#energy").textContent = Math.floor(S.energy);
  $("#gems").textContent = S.gems;
  $("#level").textContent = S.level;
  $("#xptext").textContent = S.xp + "/" + S.xpMax + " XP";
  $("#xpbar").style.width = (100*S.xp/S.xpMax) + "%";
  $("#combo").textContent = "x" + S.combo.toFixed(2);
}
function renderDaily(){
  const day = 24*3600*1000; const available = (now()-S.daily.last)>day;
  $("#dailyInfo").textContent = available ? "Available" : "Come back tomorrow";
  $("#claimDaily").disabled = !available;
}
function renderShop(){
  const wrap=$("#shopList"); wrap.innerHTML="";
  Shop.forEach(item=>{
    const lvl = S.upgrades[item.id]?.lvl||0;
    const price = Math.floor(item.base*Math.pow(item.grow,lvl));
    const div=document.createElement("div"); div.className="shopItem";
    div.innerHTML = `
      <div style="font-size:24px">${EMOJI[item.id]}</div>
      <div><b>${item.name} (Lv ${lvl})</b><div class="small">${item.desc}</div></div>
      <div class="right">
        <div class="small">Cost</div>
        <div>${coinImg} <b>${price}</b></div>
        <button class="btn buy" data-id="${item.id}" ${S.coins<price?'disabled':''}>Buy</button>
      </div>`;
    wrap.appendChild(div);
  });
  wrap.querySelectorAll(".buy").forEach(b=> b.onclick = ()=>buy(b.dataset.id));
}
function renderMissions(){
  const wrap=$("#missionList"); wrap.innerHTML="";
  S.missions.forEach(m=>{
    const p=Math.max(0,Math.min(1,m.cur/m.max)); const done = m.cur>=m.max;
    const div=document.createElement("div"); div.className="mission";
    div.innerHTML = `
      <div style="font-size:22px">📜</div>
      <div style="flex:1">
        <b>${m.name}</b>
        <div class="small">${m.cur}/${m.max} • Reward: <b>${m.type==="gems"? (m.reward+"💎") : (coinImg+" "+m.reward)} </b></div>
        <div class="prog"><div style="width:${p*100}%"></div></div>
      </div>
      <button class="btn claim" ${done?'':'disabled'} data-id="${m.id}">Claim</button>`;
    wrap.appendChild(div);
  });
  wrap.querySelectorAll(".claim").forEach(b=> b.onclick=()=>claimMission(b.dataset.id));
}
function renderRank(){
  const wrap=$("#rankTable"); wrap.innerHTML="";
  let list=getDailyRank();
  let username=$("#username").textContent;
  if(username && username.startsWith("@")) list.push([0, username, Math.floor(S.coins)]);
  else list.push([0, "@you", Math.floor(S.coins)]);
  list.sort((a,b)=>b[2]-a[2]); list = list.map((r,i)=>[i+1,r[1],r[2]]).slice(0,100);
  list.forEach(r=>{ const row=document.createElement("div"); row.className="tr"; row.innerHTML = `<div><b>#${r[0]}</b></div><div>${r[1]}</div><div>${coinImg} <b>${fmt(r[2])}</b></div>`; wrap.appendChild(row); });
}
function renderAll(){ renderTop(); renderDaily(); renderShop(); renderMissions(); renderRank(); }
renderAll();

/* Mechanics */
function tap(){
  if(S.energy<1){ toast("Out of energy 🔋"); blip(160,0.1,"square",0.3); return; }
  S.energy -= 1;
  let perTap = 1 + (S.upgrades.finger.lvl||0);
  if(S.pass) perTap *= 1.1;
  perTap *= S.combo; if(S.boostMs>0) perTap *= 2;
  const critChance = (S.upgrades.crit.lvl||0)*0.05;
  const crit = Math.random() < critChance; if(crit) perTap *= 3;
  S.coins += perTap; S.xp += 2;
  const mt=S.missions.find(m=>m.id==="taps"); if(mt) mt.cur++;
  if(S.xp>=S.xpMax){ S.level++; S.xp -= S.xpMax; S.xpMax = Math.floor(S.xpMax*1.25); toast("LEVEL UP! 🔥"); chord([523.25,659.25,783.99],0.35); }
  else { blip(420 + (crit?120:0), 0.06, crit?"triangle":"sine", 0.6); }
  S.combo = Math.max(1, Math.min(5, S.combo+0.02)); S.comboTimer=S.comboMs;
  fly(`+${fmt(perTap)}${crit?' 💥':''}`);
  const c=$("#coinBtn"); c.classList.remove("tapped"); void c.offsetWidth; c.classList.add("tapped");
  renderTop(); save();
}
function fly(text){ const f=$("#fly"); f.textContent=text; f.animate([{opacity:0, transform:"translate(-50%,-50%) translateY(10px)"},{opacity:1, transform:"translate(-50%,-50%) translateY(-6px)"},{opacity:0, transform:"translate(-50%,-50%) translateY(-18px)"}],{duration:650, easing:"ease-out"}); }

/* Loop */
let lastTick=Date.now();
function tick(){
  const t=Date.now(); const dt=t-lastTick; lastTick=t;
  S._e=(S._e||0)+dt; while(S._e>=S.energyEveryMs){ S._e-=S.energyEveryMs; S.energy = Math.max(0, Math.min(S.maxEnergy, S.energy + S.energyRegen)); }
  if(S.comboTimer>0){ S.comboTimer -= dt; if(S.comboTimer<=0) S.combo=1; }
  if(S.boostMs>0){ S.boostMs -= dt; if(S.boostMs<0) S.boostMs=0; }
  const miner=S.upgrades.miner.lvl||0; if(miner>0){ S._m=(S._m||0)+dt; while(S._m>=1000){ S._m-=1000; let gain=1*miner; if(S.pass) gain*=1.1; S.coins += gain; } }
  $("#offline").textContent = Math.floor((t - S.lastSeen)/1000) + "s";
  renderTop(); save(); requestAnimationFrame(tick);
}
requestAnimationFrame(tick);

/* Offline on load */
(function(){
  const elapsed = Date.now()-S.lastSeen;
  if(elapsed>5000){ const hours=Math.min(8, elapsed/3600000); const mult=0.1*(S.upgrades.offline.lvl||0); const miner=(S.upgrades.miner.lvl||0); const basePerSec=miner; const reward=basePerSec*hours*3600*mult; if(reward>0){ S.coins += reward; toast("Offline gains: +"+fmt(reward)); } }
  S.lastSeen = Date.now(); save();
})();

/* Actions */
$("#coinBtn").addEventListener('click', ()=>{ initAudio(); startIntroMusic(); tap(); });
$("#claimDaily").onclick = ()=>{ initAudio(); blip(660,0.08,"square",0.5); const day=24*3600*1000; if(Date.now()-S.daily.last<day) return; S.daily.last=Date.now(); S.daily.streak=Math.min(30, S.daily.streak+1); const reward=80*S.daily.streak; S.coins += reward; toast("Daily +"+fmt(reward)+" (streak "+S.daily.streak+")"); renderDaily(); renderTop(); save(); };
$("#boost").onclick = ()=>{ initAudio(); blip(520,0.08,"triangle",0.5); if(S.boostMs>0){ toast("Boost already active"); return; } if(S.gems<1){ toast("Need gems 💎"); blip(160,0.12,"square",0.25); return; } S.gems -=1; S.boostMs=60000; toast("Boost x2 for 60s!"); renderTop(); save(); };
function buy(id){ initAudio(); const item=Shop.find(s=>s.id===id); const lvl=S.upgrades[id].lvl||0; const price=Math.floor(item.base*Math.pow(item.grow,lvl)); if(S.coins<price){ toast("Not enough coins"); blip(160,0.12,"square",0.25); return; } S.coins -= price; S.upgrades[id].lvl=lvl+1; if(id==="energy"){ S.maxEnergy += 10; S.energyRegen += 0.2; } blip(700,0.08,"sine",0.6); toast(item.name+" Lv "+(lvl+1)+" purchased!"); renderTop(); renderShop(); save(); }
function claimMission(id){ initAudio(); const m=S.missions.find(x=>x.id===id); if(!m||m.cur<m.max) return; if(m.type==="gems"){ S.gems+=m.reward; } else { S.coins+=m.reward; } blip(760,0.1,"triangle",0.6); toast("Mission reward: +" + (m.type==="gems" ? (m.reward+"💎") : (fmt(m.reward)))); if(m.id!=="level"){ m.cur=0; m.max=Math.floor(m.max*1.8); m.reward=Math.floor(m.reward*1.8); } renderMissions(); renderTop(); save(); }
$("#spinWheel").onclick = ()=>{ initAudio(); if(S.gems<1){ toast("Need 1 gem"); blip(160,0.12,"square",0.25); return; } if(S.wheelCooldown>Date.now()){ toast("Please wait..."); return; } S.gems -=1; renderTop(); const wheel=$("#wheel"); const deg=360*5 + Math.floor(Math.random()*360); wheel.style.transition="transform 2.2s cubic-bezier(.2,.8,.2,1)"; wheel.style.transform=`rotate(${deg}deg)`; chord([392,523,659],0.5); setTimeout(()=>{ const sector = Math.floor(((deg%360)+22.5)/45)%8; const rewards=[100,1,300,2,150,1,500,3]; let reward=rewards[sector]; if(sector%2===0){ S.coins += reward; toast("Wheel: +"+fmt(reward)+" "); } else { S.gems += reward; toast("Wheel: +"+reward+"💎"); } blip(520,0.1,"sine",0.5); S.wheelCooldown = Date.now()+2000; renderTop(); save(); },2300); };
/* Tabs */
$$(".tab").forEach(t=> t.onclick = ()=>{ initAudio(); blip(380,0.06,"sine",0.4); $$(".tab").forEach(x=>x.classList.remove("active")); t.classList.add("active"); const id=t.dataset.view; $$(".view").forEach(v=>v.classList.remove("active")); $("#view-"+id).classList.add("active"); });
/* Anti-cheat */
(function(){ const orig=localStorage.setItem; localStorage.setItem=function(k,v){ if(k===STATE_KEY){ try{ const d=JSON.parse(v); if(d.coins>1e15) return; }catch(e){} } return orig.apply(this, arguments); }; })();
/* missions progress */
setInterval(()=>{ const mc=S.missions.find(x=>x.id==="coins"); if(mc) mc.cur=Math.max(mc.cur, Math.floor(S.coins)); const ml=S.missions.find(x=>x.id==="level"); if(ml) ml.cur=Math.max(ml.cur, S.level); renderMissions(); save(); },1500);
/* Save on unload */
window.addEventListener("beforeunload", ()=>{ S.lastSeen=Date.now(); save(); });
/* Splash */
window.addEventListener("load", ()=>{ const splash=$("#splash"); const bar=$("#progress-bar"); const app=$("#app"); let progress=0; const it=setInterval(()=>{ progress += Math.random()*18; if(progress>=100){ progress=100; clearInterval(it); setTimeout(()=>{ splash.style.opacity=0; setTimeout(()=>{ splash.style.display="none"; app.removeAttribute("aria-hidden"); },620); },280); } bar.style.width=progress+"%"; },300); });
